    // 
    var typeColorMap = {
      "cpu_standard_attn": '#f19e9cff',
      "cpu_flash_attn": '#ef7f51ff',
      "gpu_flash_attnv1": '#78d3acff',
      "gpu_flash_attnv2": '#9355b0ff',
    };

    function getColor(type) {
      return typeColorMap[type] || '#000';
    }

    // 
    data = data.map(item => [...item, getColor(item[4])]);

    var mainDom = document.getElementById('container');
    var mainChart = echarts.init(mainDom);

    var mainOption = {
      tooltip: {},
      grid3D: {
        width: '100%',
        boxWidth: 80,
        boxHeight: 80,
        boxDepth: 80,
        light: {
          main: {
            intensity: 1.2,
            shadow: true
          },
          ambient: {
            intensity: 0.3
          }
        }
      },
      xAxis3D: {
        name: 'N(seq_len)'
      },
      yAxis3D: {
        name: 'd(hidden_dim)'
      },
      zAxis3D: {
        name: 'time'
      },
      dataset: {
        dimensions: [
          'N(seq_len)',
          'd(hidden_dim)',
          'Nxd',
          'time',
          { name: 'Type', type: 'ordinal' },
          { name: 'Color', type: 'ordinal' }
        ],
        source: data
      },
      series: [
        {
          type: 'scatter3D',
          symbolSize: 5,
          encode: {
            x: 'N(seq_len)',
            y: 'd(hidden_dim)',
            z: 'time',
            tooltip: [0, 1, 2, 3, 4]
          },
          itemStyle: {
            color: function(params) {
              return params.data[5]; // 
            }
          }
        }
      ]
    };

    mainChart.setOption(mainOption);

    var originalData = data.slice(); // 
    var filteredData = null; // 

    function createChart(domId, xIndex, yIndex, xName, xType='value', xRot='0', xDownOffset=0) {
      var dom = document.getElementById(domId);
      var chart = echarts.init(dom);
      var option = {
        tooltip: {},
        xAxis: {
          type: xType,
          name: xName,
          nameLocation: 'middle',
          nameGap: 30,
          axisLabel: {
            rotate: xRot,
            align: 'center',
            interval: 0, // Show all labels
            formatter: function (value) {
              return '{value|' + value + '}';
            },
            rich: {
              value: {
                padding: [xDownOffset, 0, 0, 0] // Top, Right, Bottom, Left
              }
            }
          }
        },
        yAxis: {
          type: 'value',
          name: 'time'
        },
        dataset: {
          dimensions: [
            'N(seq_len)',
            'd(hidden_dim)',
            'Nxd',
            'time',
            { name: 'Type', type: 'ordinal' },
            { name: 'Color', type: 'ordinal' }
          ],
          source: data
        },
        series: [{
          type: 'scatter',
          symbolSize: 5,
          encode: {
            x: xIndex,
            y: yIndex,
            tooltip: [0, 1, 2, 3, 4]
          },
          itemStyle: {
            color: function(params) {
              return params.data[5]; // 
            }
          }
        }]
      };

      chart.setOption(option);

      chart.on('click', function(params) {
        if (filteredData) {
          // 
          option.dataset.source = originalData.map(item => {
            item[5] = `${item[5].slice(0,7)}ff`;
            return item
          });
          filteredData = null;
        } else {
          // 
          var selectedType = params.data[4];
          filteredData = originalData.map(item => {
            item[5] = item[4] === selectedType?item[5]:`${item[5].slice(0,7)}19`;
            return item
          });
          option.dataset.source = filteredData;
        }
        chart.setOption(option);
      });

      return chart;
    }

    var chart1 = createChart('chart1', 'N(seq_len)', 'time', 'N(seq_len)');
    var chart2 = createChart('chart2', 'd(hidden_dim)', 'time', 'd(hidden_dim)');
    var chart3 = createChart('chart3', 'Type', 'time', 'Type', 'category', 10, 15);
    var chart4 = createChart('chart4', 'Nxd', 'time', 'Nxd');

    window.addEventListener('resize', function() {
      mainChart.resize();
      chart1.resize();
      chart2.resize();
      chart3.resize();
      chart4.resize();
    });

    // 3D
    mainChart.on('click', function(params) {
      if (filteredData) {
        // 
        mainOption.dataset.source = originalData.map(item => {
            item[5] = `${item[5].slice(0,7)}ff`;
            return item
          });
        filteredData = null;
      } else {
        // 
        var selectedType = params.data[4];
          filteredData = originalData.map(item => {
            item[5] = item[4] === selectedType?item[5]:`${item[5].slice(0,7)}19`;
            // console.log(item)
            return item
          });
        mainOption.dataset.source = filteredData;
      }
      mainChart.setOption(mainOption);
      chart1.setOption({dataset: {source: mainOption.dataset.source}});
      chart2.setOption({dataset: {source: mainOption.dataset.source}});
      chart3.setOption({dataset: {source: mainOption.dataset.source}});
      chart4.setOption({dataset: {source: mainOption.dataset.source}});
    });
